Aunque puedo reconocer que este es un soneto de Francisco de Quevedo y conozco los primeros versos, no me siento completamente seguro de reproducir exactamente su continuación. La estructura sugiere que es un soneto, por lo que tendría otros cuatro versos en la segunda cuarteta y dos tercetos posteriores, pero sin poder garantizar una reproducción textual exacta.
